import React, { Component } from 'react';
import Typography from '@material-ui/core/Typography';
import Icon from 'react-icons-kit';
import { medium } from 'react-icons-kit/fa/medium';
import { socialTwitter } from 'react-icons-kit/ionicons/socialTwitter';
import IconButton from '@material-ui/core/IconButton';
import {paperPlane} from 'react-icons-kit/fa/paperPlane';
import SendFeedback from './sendFeedback';

class Footer extends Component {
  render() {
    return (
      <div className='Footer' style={{display:"flex", justifyContent:"space-between", alignItems:"center" }} >
        <div className="left" style={{marginLeft:"5px"}}>
        <SendFeedback props={this.props}/>
        </div>
        <div className="Middle">
          <Typography variant="caption" gutterBottom align="center">
           Source Alpha v0.2 Â© 2018
           </Typography>
        </div>
        <div className='Icons'>
          <a href="https://t.me/joinchat/JMBo4kzE_1SCgMbeuqvCJQ">
            <IconButton className="Telegram">
              <Icon icon={paperPlane}/>
            </IconButton>
          </a>
          <a href="https://medium.com/source-blog">
            <IconButton>
              <Icon icon={medium}/>
            </IconButton>
          </a>
          <a href="https://twitter.com/Source_platform">
            <IconButton>
              <Icon icon={socialTwitter}/>
            </IconButton>
          </a>
        </div>
      </div>
    );
  }
}

export default Footer;
